  validarEstaciones() {
    let aum;
    this.estaciones.forEach((element, index) => {
      if (element.estado) {
        this.estacionesValidas.push(element);
      }
    });
    //ordenar datos del array
    this.estacionesValidas.sort(function (a, b) {
      if (a.id > b.id) {
        return 1;
      }
      if (a.id < b.id) {
        return -1;
      }
      return 0;
    });
  }

